import GenericNode from './GenericNode';

function LLMNode({ id }) {
  return (
    <GenericNode
      title="LLM Node"
      className="llm-node"
      inputHandles={[{ id: 'input' }]}
      outputHandles={[{ id: 'output' }]}
      nodeId={id}
    >
      <p>Large Language Model</p>
    </GenericNode>
  );
}

export default LLMNode;
